import React from "react";
const Dragons = (props) => {
    console.log(props.description.length);
  return (
    <div style={{ marginTop: "90px" }}>
      <div
        className="card my-5 mx-3 bg-dark  text-light"
        style={{ width: "40rem", marginTop: "110px" }}
      >
        <div className="card-header">{props.name}</div>
        <div className="card-body">
          <h5 className="card-title ">
            active: <strong className="text-success">{props.active === true ? "true" : "false"}</strong>
          </h5>
          <p className="card-text">{props.description}</p>
          <ul className="list-group bg-dark  text-light">
            <li className="list-group-item bg-dark  text-light">
              <strong className="text-danger">Crew Capacity</strong> :
              {props.crew_capacity}
            </li>
            <li className="list-group-item bg-dark  text-light">
              <strong className="text-danger"> Mass:</strong> :{props.mass}
            </li>
            <li className="list-group-item bg-dark  text-light">
              {props.size}
            </li>
            <li className="list-group-item bg-dark  text-light">
              Porta ac consectetur ac
            </li>
            <li className="list-group-item bg-dark  text-light">
              {props.size}
            </li>
          </ul>
          <a href={props.wikipedia} className="btn btn-primary">
            Go somewhere
          </a>
        </div>
      </div>
    </div>
  );
};
export default Dragons;
